import {React, useState} from "react"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import {  faBars } from "@fortawesome/free-solid-svg-icons"
import '../css/navbar.css'

export default function Navbar(){

    const { data } = require("../data.js")

    /** this function handles the openening the of the nav menu */
    function handleOnItemClick(item){
        return(
            <div className="nav-item-wrapper">
                <section className="nav-item-section">
                    <h1 className="nav-item-title">{item.string}</h1>
                </section>
            </div>
        )
    }
    function handleOnNavClick(){
        return(
            console.log("Menu Clicked")
        )
    }


    return (
        <nav className="navigation">
            <img className="navigation-logo" src="../../images/mandala.png" alt="" />
            <FontAwesomeIcon onClick={handleOnNavClick} className="navigation-bar" icon={faBars}/>

            <ul className="navigation-list">
                {data.map(item => {
                    return <li className="navigation-item" onClick={() => handleOnItemClick(item)} key={item.id}>{item.nav_str}</li>
                })}
            </ul>
        </nav>
    )
}
